<!DOCTYPE html>
<html>
<head>
  <meta charset="utf-8">
  <title>geoquest</title>
  <script>
    // GitHub Pages SPA redirect
    var l = window.location;
    l.replace(l.protocol + '//' + l.host + l.pathname.split('/').slice(0, 1).join('/') +
      '/?p=' + encodeURIComponent(l.pathname + l.search) + l.hash);
  </script>
</head>
<body></body>
</html>
